(31, 0, 0, 1682535619, '', 1679071375, 7, 'a:1:{i:0;s:2:\"33\";}', NULL, '', 'augen-zu-und-ohren-auch', '', 'S0001', 'Augen zu und ... Ohren auch!', 'Strandgut &#40;Elbe&#41;, Silicon, Puppenkopf / 2013-2014', '<p><span lang=\"de-DE\">Aus kleinen bunten Plastikteilen ist diese Maske entstanden. Sie repräsentiert den Menschen und steht symbolisch als Mahnmal für das Sterben. Was uns daran erinnern sollte, dass wir letztendlich verantwortlich für den desaströsen Zustand unseres Planeten sind.</span></p>', '', NULL, NULL, '', 'a:2:{s:4:\"unit\";s:2:\"kg\";s:5:\"value\";s:0:\"\";}', '', '', '0.00', , '', NULL, '', '1', '', '', '', '37', '28', '24', '1', '1', 0),
(32, 0, 0, 1682535794, '', 1679072602, 7, 'a:1:{i:0;s:2:\"33\";}', NULL, '', 'erstickungsgefährdet', '', 'S0002', 'Erstickungsgefährdet', 'Strandgut &#40;Elbe&#41;, Ackryl, Hartlaminat-Arbeitsplatte / 2020', '<p><span lang=\"de-DE\">Zwei Einweg Aluteller als Maske, über die Maske ein Orangen Netz, alles auf einem Stück Hartlaminat-Arbeitsplatte.</span></p>\n<p><span lang=\"de-DE\">Mit dieser Arbeit möchte ich das Leid der Natur vermitteln und zwei Frage stellen:</span></p>\n<p style=\"padding-left: 40px;\"><span lang=\"de-DE\">Sind alle Menschen in der Lage, sich in das Leiden der Tiere hineinzuversetzen?</span></p>\n<p style=\"padding-left: 40px;\"><span lang=\"de-DE\"> Wenn ja, </span><span lang=\"de-DE\">warum lassen wir es zu, dass es passiert, warum tun wir nicht genug dagegen?</span></p>', '', NULL, NULL, '', 'a:2:{s:4:\"unit\";s:2:\"kg\";s:5:\"value\";s:0:\"\";}', '', '', '0.00', , '', NULL, '', '1', '', '', '', '50', '18', '12', '4', '0', 0),
(33, 0, 0, 1683064913, '', 1679072864, 7, 'a:1:{i:0;s:2:\"33\";}', NULL, '', 'elbperlen', '', 'S0003', 'Elbperlen', 'Strandgut &#40;Elbe&#41;, Rahmen, Spiegel / 2021', '<p><span lang=\"de-DE\">Mit einer Länge von 1094,26 km (1245 km inkl. Moldau) ist die Elbe der zwölftlängste Fluss in Europa und gehört zu den 100 längsten Flüssen der Erde.</span></p>\n<p><span lang=\"de-DE\">Dieser kleinen &#34;Perlen&#34; nur in ein paar Minuten am Ufer des Blankeneser Strands gesammelt, sind Zeuge, wie viel kleine Teile im Fluss sich auf die &#34;Reise&#34; ins Meer bewegen. Ich finde keine Antwort auf meine Frage, wo landen bzw woher kommen diese Plastik Pellets im Fluss? Wer steckt dahinter?, Kann man etwas dagegen tun?</span></p>', '', NULL, NULL, '', 'a:2:{s:4:\"unit\";s:2:\"kg\";s:5:\"value\";s:0:\"\";}', '', '', '0.00', 0x613a313a7b693a303b613a353a7b733a333a22737263223b733a31363a22696d675f323032312d332d322e6a7067223b733a333a22616c74223b733a393a22456c627065726c656e223b733a343a226c696e6b223b733a303a22223b733a343a2264657363223b733a393a22456c627065726c656e223b733a393a227472616e736c617465223b733a333a22616c6c223b7d7d, '', NULL, '', '1', '', '', '', '25', '25', '6', '3', '3', 0),
(34, 0, 0, 1682537033, '', 1679073170, 7, 'a:1:{i:0;s:2:\"33\";}', NULL, '', 'speed-limit-00-kinder-bueno', '', 'S0004', 'Speed Limit 0,0 Kinder Bueno', 'Strandgut &#40;Elbe&#41;, verlassene Vogelnetzer, Feder, Alufolie, Ackryl, Foto, Stoffbänder, Luftballons, MDF Platte / 2021', '<p><span lang=\"de-DE\">Ironisch und als ein unerreichbares Ziel sollte der Titel klingen. Gerade Kinder werden von der Industrie mit Produkten beworben, die viel Müll verursachen und obendrein ungesund sind.</span></p>\n<p><span lang=\"de-DE\">Die Industrie bringt täglich Millionen von Gegenständen auf den Markt. Angeblich um den Hunger unserer Gesellschaft zu stillen. Letztendlich ist der Hauptgrund, Geld damit zu gewinnen. Eine große Mehrheit dieser Dinge sind nicht unbedingt zu gebrauchen. Dazu kommt noch, dass sie ungesund sind.</span></p>\n<p><span lang=\"de-DE\">Besonders Kinder eigenen sich als eine gute „Klientel“ für diese Gegenstände. Dabei wird viel an Werbung investiert. Hier in dem Werk nutze ich zwei verlassene Vogelnetze, drinnen jeweils eine Kapsel von Kinder-„Bueno“ bzw. Überraschungsei. (Dieses Wortspiel ist ironisch gemeint, denn bueno auf Spanisch bedeutet „gut“, obwohl sich die Kinder aus Unwissenheit nicht gut verhalten.) Die Kapseln sind am Ufer der Elbe gesammelt, die Schnüre und Luftballons zeigen eine von vielen Möglichkeiten, wie Tiere an diesen Folgen verenden</span></p>\n<p><span lang=\"de-DE\">Speed Limit 0,0 ist ein unerreichbares Ziel, so wie aktuell die Ziele gegen den CO2-Ausstoß klingen.</span></p>\n<p><span lang=\"de-DE\">Mein Wunsch bzw. Traum wäre, dass man ein Ziel von 0,0 Vermüllung in der Natur erreicht.</span></p>\n<p><span lang=\"de-DE\">Die Federn stehen als Symbol für die Millionen von Vögeln, die ihr Leben durch das unachtsame Verhalten der Menschen verlieren.</span></p>\n<p><br><br></p>', '', NULL, NULL, '', 'a:2:{s:4:\"unit\";s:2:\"kg\";s:5:\"value\";s:0:\"\";}', '', '', '0.00', , '', NULL, '', '1', '', '', '', '50', '50', '12', '2', '', 0),
(35, 0, 0, 1682441336, '', 1679073393, 9, 'a:1:{i:0;s:2:\"58\";}', NULL, '', 'schneller-schlau', '', 'K0001', 'Schneller schlau', '2021', '<p><span lang=\"de-DE\">Einer von viele Berichten aus verschiedenen Zeitungen ist das Thema Plastik-Vermüllung in der ganzen Welt. Diese Berichte werden oft ignoriert, denn viele haben kein Interesse, sich mit dem Thema zu befassen, und bleiben lieber nicht &#34;schlau&#34;.</span></p>\n<p><span lang=\"de-DE\">Deshalb habe ich mir die Mühe gegeben, ein paar Zeilen zu markieren, und sie mit Rot am Rand wieder hinzuschreiben.</span></p>\n<p><span lang=\"de-DE\">Die Kollage besteht aus Fotos von mir und aus dem Internet. Sie sprechen für sich.</span></p>', '', NULL, NULL, '', 'a:2:{s:4:\"unit\";s:2:\"kg\";s:5:\"value\";s:0:\"\";}', '', '', '0.00', , '', NULL, '', '1', '', '', '', '50', '60', '0,2', '2', '', 0),
